**Key Psychological Mechanisms Involved:**

1. **Fairness:** Responders are likely sensitive to the fairness of the offer.  An offer perceived as unfair is less likely to be accepted.  Fairness here is not simply an equal split, but a split proportional to the relative contributions (tokens) of each player.

2. **Self-Interest:** Responders will prioritize maximizing their own monetary gain.  A higher monetary offer will be more attractive, all else being equal.

**How These Mechanisms Interact:**

Fairness and self-interest often conflict. A completely fair offer might not maximize personal gain, and a highly self-interested offer might be perceived as unfair and rejected. The responder's decision will be a trade-off between these two motivations.

**Mathematical Form:**

We can capture this trade-off using a utility function that combines both fairness and self-interest.  A simple multiplicative model will allow us to easily explore the relative weights of these two factors, as well as their interactions.


**Parameters:**

We will need two learnable parameters:

1.  `fairness_weight`:  This parameter represents the relative importance of fairness to the responder.  A higher value indicates a greater sensitivity to fairness.
2.  `self_interest_weight`: This parameter represents the relative importance of self-interest to the responder.  A higher value indicates a greater sensitivity to the monetary gain.

