def simulate_model(trial_data, self_interest_weight=1, fairness_weight=1):
    utility_values = []
    for trial in trial_data:
        split_self = trial.get("split_self", 0)
        token_self = trial.get("token_self", 1) #add 1 to avoid division by zero
        token_opp = trial.get("token_opp", 1) #add 1 to avoid division by zero

        if token_self == 0 and token_opp ==0:
            fairness_term = 0 # Avoid division by zero when both tokens are zero
        elif token_self == 0:
            fairness_term = 0 # Avoid division by zero when self tokens are zero
        else:
            fairness_term = (split_self / (token_self / (token_self + token_opp)))

        utility = (self_interest_weight * split_self) + (fairness_weight * fairness_term)
        utility_values.append(utility)
    return utility_values
